import React from 'redux-thunk/doguinhos-app/node_modules/@types/react';
import ReactDOM from 'react-dom';
import { Provider } from 'redux-thunk/doguinhos-app/node_modules/@types/react-redux';
import App from 'redux-thunk/doguinhos-app/src/App';
import { store } from 'redux-thunk/doguinhos-app/src/store';

ReactDOM.render(
    <Provider store={ store }>
      <App />
    </Provider>,
  document.getElementById('root'),
);